import zhMessages from "../locales/zh-Hans.json";

const zh =
  "输入新密码并进行确认用户名密码或者点击任意按钮未读电子邮件电子邮件地址查看购物车查看全部我的简历";

const randomNumber = Math.floor(Math.random() * zh.length);

let text = "Hello world!";

console.log("slice text: ", text.slice(0, 3));

zhMessages["sidebar.publisher"] = "输入新";

const Zhlang = () => {
  const ZhLan = {
    messages: {
      ...zhMessages,
    },
    antd: null,
    locale: "zh-Hans-CN",
  };

  return;
};

export default ZhLan;
